QuienSomos.create!([
  {mision: "<p>Suministrar servicios de ingenier&iacute;a el&eacute;ctrica, mec&aacute;nica y afines de excelente calidad, a trav&eacute;s de un talento humano motivado y competente, utilizando alta tecnolog&iacute;a y mejorando continuamente nuestros procesos; generando rentabilidad a sus accionistas, empleados y clientes, garantizando la seguridad y salud de las personas involucradas, y siendo solidarios social y ambientalmente.</p>\r\n", vision: "<section>\r\n<p>Para el a&ntilde;o 2020, se esta ejecutando proyectos de gran envergadura y comercializando productos innovadores tanto nacional como internacionalmente, utilizando tecnolog&iacute;a de punta y procesos estandarizados.</p>\r\n</section>\r\n\r\n<footer>\r\n<ul>\r\n</ul>\r\n</footer>\r\n", politica_integral: "<p><strong>SERVIDUAL</strong>&nbsp;Es una empresa prestadora de soluciones integrales en ingenier&iacute;a de proyectos, comprometida con el desarrollo y el bienestar de su talento humano y con el mejoramiento continuo de los procesos; siempre buscando la satisfacci&oacute;n de nuestros clientes y proveedores, y a su vez garantizando ambientes de trabajo seguros y saludables que permitan prevenir las lesiones y enfermedades laborales a trav&eacute;s de la identificaci&oacute;n, control y mitigaci&oacute;n de los riesgos, incluidos los asociados al transporte de personas, productos y servicios; trabajando en la prevenci&oacute;n de la contaminaci&oacute;n, el impacto socio-ambiental, y los da&ntilde;os en la propiedad.<br />\r\nComo soporte estamos comprometidos con el cumplimiento permanente de la legislaci&oacute;n Colombiana y otros requisitos con transparencia y honestidad, generando espacios que impulsan el desarrollo social de nuestra comunidad y asegurando el respaldo econ&oacute;mico para el funcionamiento del sistema de gesti&oacute;n integral.</p>\r\n", valores_corporativos: "<p><strong>Servicio (Atenci&oacute;n a los Clientes):&nbsp;</strong>Disponibilidad de las personas para superar o satisfacer las expectativas de los clientes, atendi&eacute;ndolos de una manera cordial y amable en todo momento.</p>\r\n\r\n<p><strong>Responsabilidad:</strong>&nbsp;es un valor que le permite reflexionar, administrar, orientar y valorar las consecuencias de sus actos, adem&aacute;s de cumplir de manera eficiente con las actividades y tareas encomendadas.</p>\r\n\r\n<p><strong>Compa&ntilde;erismo:&nbsp;</strong>Consiste en saber valorar los intereses y necesidades de otro individuo, y saber cu&aacute;les son mis l&iacute;mites y hasta donde puedo llegar.</p>\r\n\r\n<p><strong>Transparencia (Honestidad):</strong>&nbsp;Es aquella cualidad humana por la que la persona se determina a elegir actuar siempre con base en la verdad y en la aut&eacute;ntica justicia siempre siendo decente, recatado, razonable, justo, honrado y honesto.</p>\r\n\r\n<p><strong>Respeto:&nbsp;</strong>Consiste en saber valorar los intereses y necesidades de otro individuo, y saber cu&aacute;les son mis l&iacute;mites y hasta donde puedo llegar.</p>\r\n", historia: ""},
